import './App.css';
import Navbar from "./components/Navbar"
import Home from "./pages/Home/Home"
import Gallery from "./pages/Gallery/Gallery"

import Footer from "./components/Footer"




function App() {
  return (
    <>

    <Navbar />

    <Home />


    <Gallery />


    <Footer />


</>
  );
}

export default App;
